/*
  1- dock-view actors to create new panels on the go

  2- Model: 2 json object (user profile{} + list of addresses[]) --> to be combined into 1 json = user
      - actor: json-combiner
      - type: logical model
      - context:
          - input: { profile: {...}, addresses: [...] }
          - processor:
              - steps
                  - Start
                  - Create Object: { user: {} }
                  - Update Object: user = { ...user, input.profile }
                  - Update Object: user = { ...user, input.addresses }
                  - End: return user
          - output: user
       - states:
          - initiating (validate inputs)
          - processing (implement steps logic)
          - completing (update output context)
          - idle

        - methods & events
            - update user object
            - update addresses object
            - run processor



  3- Views:
    a- profile object to appear in panel json-viewer panel, titled as Profile
    b- addresses object to appear in panel json-viewer panel, titled as Addresses
    c- trigger combination of json objects in actions-controller panel, titled Actions
    d- combined object profile + addresses based on C trigger,  in json-viewer panel, titled as User
    e- combined object profile + addresses based on C trigger, in profile-viewer panel, titled as User View

================

 */

